export interface QueryResult {
    query?: QuerySchema[];
    unknown?: Unknown[];
}
export interface ConditionElement {
}
export interface ConditionCompare extends ConditionElement {
    compare: Compare;
}
export interface ConditionAnd extends ConditionElement {
    and: ConditionElement[];
}
export interface ConditionNot extends ConditionElement {
    not: ConditionElement;
}
export interface ConditionOr extends ConditionElement {
    or: ConditionElement[];
}
export interface QuerySchema {
    from: string[];
    condition: ConditionElement;
}
export interface Key {
    key: string;
}
export interface Comparator {
    lt?: any;
    lte?: any;
    gt?: any;
    gte?: any;
    eq?: string | number | boolean;
    neq?: string | number | boolean;
}
export interface Compare extends Key, Comparator {
}
export interface Unknown {
    offset: number;
    length: number;
}
